--
-- Structure de la table `fiche_stagiaire`
--

DROP TABLE IF EXISTS `fiche_stagiaire`;
CREATE TABLE IF NOT EXISTS `fiche_stagiaire` (
  `matricule` varchar(50) NOT NULL,
  `nom_prenom` varchar(200) DEFAULT NULL,
  `date_naissance` date DEFAULT NULL,
  `lieu_naissance` varchar(200) DEFAULT NULL,
  `sexe` varchar(50) DEFAULT NULL,
  `nationalite` varchar(200) DEFAULT NULL,
  `situation_matrimoniale` varchar(200) DEFAULT NULL,
  `nombre_enfant` varchar(200) DEFAULT NULL,
  `ville` varchar(200) DEFAULT NULL,
  `quartier` varchar(200) DEFAULT NULL,
  `telephone` varchar(200) DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `photo` longblob NOT NULL,
  `type` varchar(200) NOT NULL,
  `nom_prenom_pere` varchar(200) DEFAULT NULL,
  `lieu_habitation_pere` varchar(200) DEFAULT NULL,
  `nationalite_pere` varchar(200) DEFAULT NULL,
  `profession_pere` varchar(200) DEFAULT NULL,
  `nombre_enfant_pere` varchar(200) DEFAULT NULL,
  `telephone_pere` varchar(200) DEFAULT NULL,
  `nom_prenom_mere` varchar(200) DEFAULT NULL,
  `lieu_habitation_mere` varchar(200) DEFAULT NULL,
  `nationalite_mere` varchar(200) DEFAULT NULL,
  `profession_mere` varchar(200) DEFAULT NULL,
  `nombre_enfant_mere` varchar(200) DEFAULT NULL,
  `telephone_mere` varchar(200) DEFAULT NULL,
  `nom_prenom_urgence` varchar(200) DEFAULT NULL,
  `lien_parente_urgence` varchar(200) DEFAULT NULL,
  `nationalite_urgence` varchar(200) DEFAULT NULL,
  `profession_urgence` varchar(200) DEFAULT NULL,
  `lieu_habitation_urgence` varchar(200) DEFAULT NULL,
  `telephone_urgence` varchar(200) DEFAULT NULL,
  `date_enregistrement` date DEFAULT NULL,
  PRIMARY KEY (`matricule`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

